import React from 'react';
import profile_pic from '../images/profile_pic.png';



const About = () => {
    return (
        <div>
            <div className='about_box flex flex-column items-center'>
                 <img id="profile_pic" alt="Profile Pic" title="Profile Pic" className="profile_pic" src={profile_pic}></img>
            </div>
        </div>
    )
}



export default About;
